import React,{Component} from "react";
import ReactDOM from "react-dom";
import {Carousel, Icon} from "antd";
import "antd/dist/antd.css";

class Slid extends Component {
    
    render() { 
        return (
            <div>
                    <Icon type="right"/>
                    <Carousel autoplay>
                    <div>
                            <img  src={require(`../static/horaire.jpg`)}  alt="Smiley face" height="400" width="400"/>
                    </div>
                    <div>
                        <h3>2</h3>
                    </div>
                    
                </Carousel>
          </div>
         );
    }
}
 export default Slid;
